import React, { useState } from "react";
import { View, Text, TextInput, TouchableOpacity, FlatList, StyleSheet } from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";

const CreateWorkoutPreset = ({ onPresetCreated }) => {
  const [presetName, setPresetName] = useState("");
  const [exercise, setExercise] = useState("");
  const [exercises, setExercises] = useState([]);
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const handleAddExercise = () => {
    if (!exercise.trim()) return;
    setExercises([...exercises, exercise.trim()]);
    setExercise("");
    setError("");
  };

  const handleRemoveExercise = (idx) => {
    setExercises(exercises.filter((_, i) => i !== idx));
  };

  const handleSavePreset = async () => {
    if (!presetName.trim()) {
      setError("Preset name is required.");
      return;
    }
    if (exercises.length === 0) {
      setError("Add at least one exercise.");
      return;
    }
    setError("");
    try {
      // Save to AsyncStorage (append to 'workout_presets')
      const key = "workout_presets";
      const existing = await AsyncStorage.getItem(key);
      let presets = existing ? JSON.parse(existing) : [];
      presets.push({ name: presetName.trim(), exercises });
      await AsyncStorage.setItem(key, JSON.stringify(presets));
      setPresetName("");
      setExercises([]);
      setSuccess("Preset saved!");
      if (onPresetCreated) onPresetCreated();
      setTimeout(() => setSuccess(""), 1500);
    } catch (e) {
      setError("Failed to save preset.");
    }
  };

  return (
    <View style={styles.section}>
      <Text style={styles.title}>Create Workout Preset</Text>
      <TextInput
        style={styles.input}
        placeholder="Preset Name"
        value={presetName}
        onChangeText={setPresetName}
        placeholderTextColor="#aaa"
      />
      <View style={styles.row}>
        <TextInput
          style={[styles.input, { flex: 1 }]}
          placeholder="Add Exercise"
          value={exercise}
          onChangeText={setExercise}
          onSubmitEditing={handleAddExercise}
          placeholderTextColor="#aaa"
        />
        <TouchableOpacity style={styles.addButton} onPress={handleAddExercise}>
          <Text style={styles.addButtonText}>Add</Text>
        </TouchableOpacity>
      </View>
      <FlatList
        data={exercises}
        keyExtractor={(_, idx) => idx.toString()}
        renderItem={({ item, index }) => (
          <View style={styles.exerciseRow}>
            <Text style={styles.exerciseText}>{item}</Text>
            <TouchableOpacity onPress={() => handleRemoveExercise(index)}>
              <Text style={styles.removeText}>Remove</Text>
            </TouchableOpacity>
          </View>
        )}
        ListEmptyComponent={<Text style={styles.empty}>No exercises added.</Text>}
      />
      {error ? <Text style={styles.error}>{error}</Text> : null}
      {success ? <Text style={styles.success}>{success}</Text> : null}
      <TouchableOpacity style={styles.saveButton} onPress={handleSavePreset}>
        <Text style={styles.saveButtonText}>Save Preset</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  section: {
    marginTop: 30,
    marginHorizontal: 18,
    backgroundColor: "#fff",
    borderRadius: 16,
    padding: 20,
    shadowColor: "#6b46c1",
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.13,
    shadowRadius: 7,
    elevation: 3,
    borderWidth: 1.2,
    borderColor: "#6b46c1",
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
    color: "#6b46c1",
    marginBottom: 14,
    alignSelf: "center",
  },
  input: {
    backgroundColor: "#f3f1fa",
    borderRadius: 7,
    borderWidth: 1,
    borderColor: "#ccc",
    padding: 10,
    fontSize: 16,
    marginBottom: 10,
    color: "#333",
  },
  row: {
    flexDirection: "row",
    alignItems: "center",
    marginBottom: 10,
  },
  addButton: {
    backgroundColor: "#6b46c1",
    borderRadius: 7,
    paddingVertical: 10,
    paddingHorizontal: 16,
    marginLeft: 8,
  },
  addButtonText: {
    color: "#fff",
    fontWeight: "bold",
    fontSize: 15,
  },
  exerciseRow: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    paddingVertical: 5,
    borderBottomWidth: 1,
    borderColor: "#eee",
  },
  exerciseText: {
    fontSize: 16,
    color: "#4B3869",
  },
  removeText: {
    color: "#c00",
    fontWeight: "bold",
    fontSize: 13,
    marginLeft: 10,
  },
  empty: {
    color: "#aaa",
    fontStyle: "italic",
    marginBottom: 10,
    alignSelf: "center",
  },
  error: {
    color: "#c00",
    marginTop: 6,
    alignSelf: "center",
  },
  success: {
    color: "#2ecc40",
    marginTop: 6,
    alignSelf: "center",
  },
  saveButton: {
    backgroundColor: "#6b46c1",
    borderRadius: 7,
    paddingVertical: 12,
    alignItems: "center",
    marginTop: 14,
  },
  saveButtonText: {
    color: "#fff",
    fontWeight: "bold",
    fontSize: 16,
  },
});

export default CreateWorkoutPreset;
